  input: 'TEXT,F3A,,"Procedures for requesting Identification Information:  When soliciting
    donations the Committee includes a clear and conspicuous request for contributor
    information including the requirements of federal law for the reporting of such
    information.  Upon receipt of a donation exceeding an aggregate total on $200
    in the election cycle, a follow-up request is made within 30 days asking for missing
    information, informing the contributor of the requirements of federal law for
    the reporting of such information, and when the request is in writing including
    a pre-addressed post card or return envelope.  Contributor information that is
    received after the contribution has been reported will be reported either as an
    amended memo Schedule A listing all contributions for which additional information
    was received or an amendment to the report originally disclosing the contribution
    will be filed on or before the next regularly scheduled reporting date.  These
    efforts have reduced the number of reportable contribution that were missing Employer
    and Occupation from 25 on the October 14, 2005, filing FEC-188899 to 10 the on
    October 28, 2005, filing FEC-190907 to 0 on this filing."'
